            } else {
              // Merge to the end of the replacements array
              replacements = Array.prototype.concat.apply(replacements, this.config.key[i].metrics[position[i]].replacements);
              titles.push(this.config.key[i].metrics[position[i]].title);
            }
          }
          this.prettyRowNames.push(this.snapshotSubPathNames[this.snapshotSubPaths[k]]+"\n"+titles.join("\n"));
          this.dataRowNames.push(this.snapshotSubPaths[k]+"\n"+replacements.join("\n"));
          if (k === 0) {
            this.keyNames.push(titles.join(" | "));
          }
          if (row[row.length - 1]) {
            row[row.length - 1].rowHeadingsEnd = true;
          }
          // Add metrics
          for (i = 0; i < this.config.ar_metric.length; i++) {
            rowConfig = CDNHelpers.shallowClone(this.config.ar_metric[i]);
            if (rowConfig.metric) {
              for (j = 0; j < replacements.length; j++) {
                if (replacements[j] === null) {
                  rowConfig.metric = removeFirstReplacement(rowConfig.metric);
                } else {
                  rowConfig.metric = rowConfig.metric.replace(/%/, replacements[j]);
                }
              }
            }
            for (property in rowConfig) {
              if (rowConfig[property] === '' + rowConfig[property] && property.substr(0, 4) === 'link') {
                for (j = 0; j < replacements.length; j++) {
                  if (replacements[j] === null) {
                    rowConfig[property] = removeFirstReplacement(rowConfig[property]);
                  } else {
                    rowConfig[property] = rowConfig[property].replace(/%/, replacements[j]);
                  }
                }
              }
            }
            // TODO This will be complicated by group graph columns
            colIndex = this.prototypeDescriptions[0].length - (this.config.ar_metric.length - i);
            row.push({
              type: 'metricValue',
              comparison: this._metricComparison(rowConfig, this.snapshotSubPaths[k], comparableSnapshots.length > 1 ? this.nestedLastSubPaths[k] : ''),
              config: rowConfig,
              groupCount: this.prototypeDescriptions[0][colIndex].groupCount,
              groupStart: this.prototypeDescriptions[0][colIndex].groupStart
            });
          }
          // Increment position through keys
          for (i = position.length - 1; i >= 0; i--) {
            position[i]++;
            if (position[i] < this.config.key[i].metrics.length) {
              break;
            }
            if (collapsible_key) {
              position[i] = -1;
            } else {
              position[i] = 0;
            }
          }
          if (collapsible_key) {
            if (position.some(function(x){return x > -1;})) {
              continue;
            }
          } else if (position.some(function(x){return x > 0;})) {
            continue;
          }
          break;
        } while (true);
      } else {
        // Single metric value row
        row = [{
          type: 'snapshotHeading',
          comparison: new CDNMetricComparison('_name_', this.snapshotSubPaths[k]),
          subPath: this.snapshotSubPaths[k],
          branch: this.snapshotBranches[this.snapshotSubPaths[k]],
          span: 1,
          rowHeadingsEnd: true
        }];
        if (this.config.inheritance_selection && this.config.inheritance_selection !== true) {
          // Forced sub-path for the per-snapshot table container
          row[0].secondarySubPath = this.config.inheritance_selection;
        }
        this.prettyRowNames.push(this.snapshotSubPathNames[this.snapshotSubPaths[k]]);
        this.dataRowNames.push(this.snapshotSubPaths[k]);
        this.dataRows++;
        this.prototypeDescriptions.push(row);
        for (i = 0; i < this.config.ar_metric.length; i++) {
          comparison = this._metricComparison(this.config.ar_metric[i], this.snapshotSubPaths[k], comparableSnapshots.length > 1 ? this.nestedLastSubPaths[k] : '');
          if (collapsible_key && this.config.ar_metric[i].metric) {
            // We may have a key defined but no metrics were matched, remove the
            // % characters from the metric name so we show the "all" row
            metricName = this.config.ar_metric[i].metric;
            while (metricName.match(/(?:^|[^\\])(?:\\\\)*%/)) {
              metricName = removeFirstReplacement(metricName);
            }
            comparison = comparison.newRelatedComparison(metricName);
          }
          // TODO This will be complicated by group graph columns
          colIndex = this.prototypeDescriptions[0].length - (this.config.ar_metric.length - i);
          row.push({
            type: 'metricValue',
            comparison: comparison,
            config: this.config.ar_metric[i],
            groupCount: this.prototypeDescriptions[0][colIndex].groupCount,
            groupStart: this.prototypeDescriptions[0][colIndex].groupStart
          });
        }
      }
    }

    if (this.config.column_graph && cdnDataManager.getComparisonCount() > 1) {
      this._prepareColumnGraph();
    }

    this._addFooters();

    this.populateGroupAndColumnSummaries();

    if (this.table && this.table.parentNode === this.container) {
      this.draw();
    }
    this.calculateAutoHide();
    this.showVisibleGraphs();
  };



  /********************************
   * nested sub path selection behavior
   */

  CDNTable.prototype._renderInheritanceSelection = function() {
    var form, label, span, select, option, i, j, selected, path, currentPath, parts, count, indent;

    function applyPathChange(event) {
      cdnPage.updateHash({path: select.value});
    }

    currentPath = cdnDataManager.getComparisonPath();
    count = cdnDataManager.getComparisonCount();

    form = document.createElement('form');
    form.addEventListener('submit', function(event) {
      event.preventDefault();
      applyPathChange(event);
    });
    form.className = 'cdn-table-filter-box';
    label = document.createElement('label');
    span = document.createElement('span');
    span.textContent = 'Show metrics for step:';
    label.appendChild(span);
    select = document.createElement('select');
    label.appendChild(select);
    option = document.createElement('option');
    option.value = '';
    option.textContent = count > 1 ? 'Last comparison step' : 'Top-level data';
    option.setAttribute('data-filter-list-all', 'yes');
    select.appendChild(option);
    parts = currentPath.split('/').filter(function(p){return !! p;});
    for (i = 0; i < parts.length; i++) {
      path = parts.slice(0, i + 1).join('/');
      option = document.createElement('option');
      option.value = path;
      indent = '';
      for (j = 0; j <= i; j++) {
        // Non-breaking space
        indent += '\xa0\xa0';
      }
      option.textContent = indent + parts[i];
      select.appendChild(option);
      if (path === currentPath) {
        option.selected = true;
        selected = true;
      }
    }
    for (i = 0; i < this.nestedSubPaths.length; i++) {
      path = this.nestedSubPaths[i];
      parts = path.split('/');
      option = document.createElement('option');
      option.value = path;
      indent = '';
      for (j = 0; j <= parts.length; j++) {
        // Non-breaking space
        indent += '\xa0\xa0';
      }
      option.textContent = indent + parts[parts.length - 1];
      select.appendChild(option);
      if (path === currentPath) {
        option.selected = true;
        selected = true;
      }
    }
    if (! selected) {
      select.firstChild.selected = true;
      select.setAttribute('data-filter-list-all', 'yes');
    }
    select.addEventListener('change', function(event) {
      if (select.value === '') {
        select.setAttribute('data-filter-list-all', 'yes');
      } else {
        select.removeAttribute('data-filter-list-all');
      }
      applyPathChange(event);
    }, false);
    form.appendChild(label);
    CDNHelpers.removeChildren(this.headerSelectionContainer);
    this.headerSelectionContainer.appendChild(form);
  };



  /********************************
   * Footers
   */

  CDNTable.prototype._addFooters = function() {
    var i, j, types, desc, comparisons, row, firstRow, comparison;

    comparisons = [];

    for (i = 1; i < this.prototypeDescriptions.length; i++) {
      for (j = this.leftHeadingCount; j < this.prototypeDescriptions[i].length; j++) {
        desc = this.prototypeDescriptions[i][j];
        if (desc && desc.type === 'metricValue' && desc.comparison) {
          if (! comparisons[j]) {
            comparisons[j] = [];
          }
          comparisons[j].push(desc.comparison);
        }
      }
    }
    this.summaryComparisons = comparisons;

    if (this.dataRows < 2) {
      return;
    }
    types = [];
    switch (this.dataRows) {
      case 0:
      case 1:
        return;
      case 2:
        if (! this.config.hide_footers) {
          if (cdnDataManager.getComparisonCount() > 1) {
            if (cdnPage.getMode() === cdnPage.MODE_AUM) {
              types.push(CDNMetricSummaryComparison.ALL_WINS_LOSSES);
            }
            types.push(CDNMetricSummaryComparison.WINS_LOSSES);
          }
          types.push(CDNMetricSummaryComparison.MEAN);
        }
        break;
      default:
        if (! this.config.hide_footers) {
          if (cdnDataManager.getComparisonCount() > 1) {
            if (cdnPage.getMode() === cdnPage.MODE_AUM) {
              types.push(CDNMetricSummaryComparison.ALL_WINS_LOSSES);
            }
            types.push(CDNMetricSummaryComparison.WINS_LOSSES);
          }
          if (cdnPage.getMode() !== cdnPage.MODE_AUM) {
            types.push(CDNMetricSummaryComparison.MINIMUM);
          }
          types.push(CDNMetricSummaryComparison.MEAN);
          if (cdnPage.getMode() !== cdnPage.MODE_AUM) {
            types.push(CDNMetricSummaryComparison.MAXIMUM);
          }
        }
        if (! this.config.hide_graph_footers) {
          types.push('graph');
        }
        break;
    }

    firstRow = true;
    for (i = 0; i < types.length; i++) {
      row = [];
      this.prototypeDescriptions.push(row);
      desc = {
        type: 'th',
        footerTitle: true,
        footerStart: firstRow
      };
      switch (types[i]) {
        case CDNMetricSummaryComparison.MINIMUM:
          desc.title = 'min';
          break;
        case CDNMetricSummaryComparison.MEAN:
          if (cdnPage.getMode() === cdnPage.MODE_AUM) {
            desc.title = 'average';
          } else {
            desc.title = 'avg';
          }
          break;
        case CDNMetricSummaryComparison.MAXIMUM:
          desc.title = 'max';
          break;
        case CDNMetricSummaryComparison.WINS_LOSSES:
          if (cdnPage.getMode() === cdnPage.MODE_AUM) {
            desc.title = 'big wins / big losses';
          } else {
            desc.title = 'wins / losses';
          }
          break;
        case CDNMetricSummaryComparison.ALL_WINS_LOSSES:
          desc.title = 'wins / losses';
          break;
        default:
          desc.title = types[i];
      }
      row.push(desc);

      for (j = this.leftHeadingCount; j < this.prototypeDescriptions[1].length; j++) {
        switch (types[i]) {
          case CDNMetricSummaryComparison.MINIMUM:
          case CDNMetricSummaryComparison.MEAN:
          case CDNMetricSummaryComparison.MAXIMUM:
            comparison = new CDNMetricSummaryComparison(types[i], comparisons[j]);
            row[j] = {
              type: 'metricValue',
              comparison: comparison,
              config: this.prototypeDescriptions[1][j].config,
              groupCount: this.prototypeDescriptions[0][j].groupCount,
              groupStart: this.prototypeDescriptions[0][j].groupStart,
              footerStart: firstRow
            };
            break;
          case CDNMetricSummaryComparison.WINS_LOSSES:
          case CDNMetricSummaryComparison.ALL_WINS_LOSSES:
            comparison = new CDNMetricSummaryComparison(types[i], comparisons[j]);
            row[j] = {
              type: 'winsLosses',
              comparison: comparison,
              config: this.prototypeDescriptions[1][j].config,
              groupCount: this.prototypeDescriptions[0][j].groupCount,
              groupStart: this.prototypeDescriptions[0][j].groupStart,
              footerStart: firstRow
            };
            break;
          default:
            row[j] = {
              type: 'graphLink',
              config: this.prototypeDescriptions[1][j].config,
              groupCount: this.prototypeDescriptions[0][j].groupCount,
              groupStart: this.prototypeDescriptions[0][j].groupStart,
              footerStart: firstRow,
              index: j - (this.prototypeDescriptions[0].length - this.config.ar_metric.length)
            };
            break;
        }
      }

      firstRow = false;
    }
  };



  /********************************
   * graph behavior
   */

  CDNTable.prototype.visibleGraphsFromConfig = function(config) {
    var i;
    for (i = 0; i < this.visibleGraphs.length; i++) {
      // Hide all graphs
      if (this.visibleGraphs === true) {
        this._toggleGraphForMetric(index, false);
      }
    }
    this.visibleGraphs = [];

    config = config || this.config;

    if (! config.ar_metric) {
      return this.visibleGraphs;
    }

    for (i = 0; i < config.ar_metric.length; i++) {
      if (config.ar_metric[i].show_graph) {
        this.visibleGraphs[i] = true;
      }
    }
    return this.visibleGraphs;
  };
  CDNTable.prototype.showVisibleGraphs = function() {
    var i, show;
    for (i = 0; i < this.visibleGraphs.length; i++) {
      // Get past the same value check
      show = !! this.visibleGraphs[i];
      this.visibleGraphs[i] = undefined;
      this._toggleGraphForMetric(i, show);
    }
  };
  CDNTable.prototype._toggleGraphForMetric = function(index, forceVisible, event) {
    var config, comparisons, cell, makeVisible, container;

    if (event) {
      event.preventDefault();
    }

    if (this.prototypeDescriptions.length <= 1) {
      // First row is headings, we need more than 1 row
      return;
    }

    config = this.config.ar_metric[index];
    comparisons = this.summaryComparisons[(this.prototypeDescriptions[1].length - this.config.ar_metric.length) + index];
    cell = this.graphLinks[index];

    switch (forceVisible) {
      case true:
      case false:
        makeVisible = forceVisible;
        break;
      default:
        makeVisible = ! this.visibleGraphs[index];
        break;
    }

    // _getGraphContainer hides the graph if that is requested
    container = this._getGraphContainer(index, cell, makeVisible);

    if (this.visibleGraphs[index] === makeVisible) {
      return;
    }

    this.visibleGraphs[index] = makeVisible;

    if (makeVisible && container) {
      switch (config.graph_type) {
        case 'treemap':
          this._prepareTreemap(index, config, comparisons, cell, container);
          break;
        case 'none':
          cell && cell.removeAttribute('data-fetching');
          break;
        case 'line':
        default:
          this._prepareLineGraph(index, config, comparisons, cell, container);
          break;
      }
    }
  };

  CDNTable.prototype._getGraphContainer = function(index, cell, makeVisible) {
    var container, node, nodeMetric, metricName, nodeHeader, headerName, i;

    metricName = this.config.ar_metric[index].metric;
    headerName = this.config.ar_metric[index].header;

    node = this.footerContainer.firstChild;
    while (node) {
      if (node.nodeType === node.ELEMENT_NODE &&
          (node.getAttribute('data-graph-metric') === metricName || node.getAttribute('data-graph-header') === headerName)) {
        if (makeVisible) {
          cell && cell.setAttribute('data-graph-open', 'yes');
          return node;
        } else {
          this.footerContainer.removeChild(node);
          cell && cell.removeAttribute('data-graph-open');
          cell && cell.removeAttribute('data-fetching');
          return;
        }
      }
      node = node.nextSibling;
    }

    if (! makeVisible) {
      cell && cell.removeAttribute('data-graph-open');
      return;
    }

    cell && cell.setAttribute('data-fetching', 'yes');
    cell && cell.setAttribute('data-graph-open', 'yes');

    container = document.createElement('div');
    container.className = 'cdn-horiz-graph-container';
    if (headerName) {
      container.setAttribute('data-graph-header', headerName);
    } else {
      container.setAttribute('data-graph-metric', metricName);
    }

    // Find container insertion point
    node = null;
    if (index < this.config.ar_metric.length - 1) {
      node = this.footerContainer.firstChild;
      nodeLoop: while (node) {
        if (node.nodeType === node.ELEMENT_NODE) {
          nodeMetric = node.getAttribute('data-graph-metric');
          nodeHeader = node.getAttribute('data-graph-header');
          for (i = index + 1; i < this.config.ar_metric.length; i++) {
            if (nodeMetric === this.config.ar_metric[i].metric || nodeHeader === this.config.ar_metric[i].header) {
              break nodeLoop;
            }
          }
        }
        node = node.nextSibling;
      }
    }
    this.footerContainer.insertBefore(container, node);
    return container;
  };

  CDNTable.prototype._prepareLineGraph = function(index, config, comparisons, cell, container) {
    if (cdnDataManager.getComparisonMethod() === cdnDataManager.COMPARE_RUNS) {
      // Hopefully shortcut any fetches by fetching the comparable objects at the
      // current level so the metric comparisons don't have to fetch the
      // individual subPaths.
      cdnDataManager.getComparableThings(function(){});
    }
    CDNHelpers.waitForAll(comparisons, function(comparison, intermediate) {
      comparison.getValueDescriptions(intermediate);
    }.bind(this), this._renderLineGraph.bind(this, index, config, comparisons, cell, container));
  };

  CDNTable.prototype._renderLineGraph = function(index, config, comparisons, cell, container, allValues) {
    var i, j, keys, timeGraph, times, total, path, runIds, names, seconds, configuration, dataPoints, legendWidth, firstLabelGutter, yAxisGutter, yAxisName, xAxisLabels, xAxisCount;

    cell && cell.removeAttribute('data-fetching');

    timeGraph = new CDNChart_line();

    runIds = cdnDataManager.getComparableLabels();
    // GOLD POSITION
    runIds.unshift(runIds.pop());
    names = {};

    xAxisLabels = {};
    xAxisCount = 0;

    times = [];
    keys = [];
    if (this.config.per_snapshot && this.config.key && this.config.key.length) {
      keys = this.keyNames;
      times = keys.map(function(key, i) {
        names[CDNColor.get(i)] = key;
        return {
          name: key,
          data: {}
        }
      });
      xAxisLabels = this.snapshotSubPathNames;
      xAxisCount = this.snapshotSubPaths.length;
      allValues.map(function(comparableDescription, i){
        var pathName, rowName, description, key, keyIndex;
        if (comparableDescription) {
          // TODO: comparisons
          description = comparableDescription[0];
          keyIndex = i % this.keyNames.length;
          if (description && description.defined && description.number) {
            rowName = this.snapshotSubPaths[Math.floor(i / this.keyNames.length)];
            times[keyIndex].data[rowName] = description.rawValue;
            if (description.rawUnits === 's') {
              seconds = true;
            }
          }
        }
      }.bind(this));
    } else {
      for (i = 0; i < runIds.length; i++) {
        names[CDNColor.get(i)] = runIds[i];
      }
      for (i = 0; i < this.dataRowNames.length; i++) {
        xAxisLabels[this.dataRowNames[i]] = this.prettyRowNames[i];
      }
      xAxisCount = this.dataRowNames.length;
      allValues.map(function(comparableDescription, i){
        var pathName, rowName;
        if (comparableDescription) {
          comparableDescription.map(function(description, j){
            if (! times[j]) {
              times[j] = {
                name: runIds[j],
                data: {}
              };
            }
            if (description && description.defined && description.number) {
              rowName = this.dataRowNames[i];
              times[j].data[rowName] = description.rawValue;
              if (description.rawUnits === 's') {
                seconds = true;
              }
            }
          }.bind(this));
        }
      }.bind(this));
    }

    if (this.config.reverse_graph_snapshot_order) {
      times.map(function(line) {
        var key, keys, i, newData;
        // Data is a hashed object, Array.reverse will not work
        keys = [];
        for (key in line.data) {
          keys.push(key);
        }
        newData = {};
        for (i = keys.length - 1; i >= 0; i--) {
          newData[keys[i]] = line.data[keys[i]];
        }
        line.data = newData;
      });
    }

    legendWidth = (runIds.length > 1 || allValues.length !== this.snapshotSubPaths.length) ? 100 : 10;
    firstLabelGutter = 30;
    yAxisGutter = 50;
    yAxisName = '';
    if (config.group) {
      yAxisName += config.group + ' | ';
    }
    if (config.title) {
      yAxisName += config.title;
    } else if (config.header) {
      yAxisName += config.header;
    } else {
      // FIXME: use cdnDataManager.translateMetricName
      yAxisName += config.metric;
    }
    configuration = {
      arSeries: times,
      colorName: names,
      transXLabel: xAxisLabels,
      yAxisName: yAxisName,
      legendWidth: legendWidth,
      width: (yAxisGutter + firstLabelGutter + (Math.max(0, (xAxisCount - 1)) * 30) + legendWidth)
    };
    if (seconds) {
      configuration.fnRendValue = function(seconds) {
        return CDNDataCell.renderSeconds(seconds, 0);
      };
    }
    container.appendChild(timeGraph.init(configuration));
  };

  CDNTable.prototype._prepareTreemap = function(index, config, comparisons, cell, container) {
    if (cdnDataManager.getComparisonMethod() === cdnDataManager.COMPARE_RUNS) {
      // Hopefully shortcut any fetches by fetching the comparable objects at the
      // current level so the metric comparisons don't have to fetch the
      // individual subPaths.
      cdnDataManager.getComparableThings(function(){});
    }
    CDNHelpers.waitForAll(comparisons, function(comparison, intermediate) {
      comparison.getValueDescriptions(intermediate);
    }.bind(this), this._renderTreemap.bind(this, index, config, comparisons, cell, container));
  };

  CDNTable.prototype._renderTreemap = function(index, config, comparisons, cell, container, allValues) {
    var runIds, configuration, data, i, j, k, rowDesc, name, fullName, goldCol, branch, found, child, components, treemap, keys;

    cell && cell.removeAttribute('data-fetching');
    runIds = cdnDataManager.getComparableLabels();
    // GOLD POSITION
    runIds.unshift(runIds.pop());

    goldCol = runIds.length - 1;

    data = {
      name: 'Top',
      fullName: 'Top',
      size: 0,
      children: [],
      comparisons: []
    };

    if (this.config.hierarchical_separator) {
      nextRow: for (i = 0; i < allValues.length; i++) {
        branch = data;
        keys = this.keyNames[i % this.keyNames.length].split("\n");
        fullName = this.dataRowNames[i];
        if (this.config.per_snapshot) {
          name = this.prettyRowNames[i].split("\n")[0];
        } else {
          name = '';
        }
        components = [];
        if (keys.length) {
          // Assume single key and single replacement
          components = keys[0].split(this.config.hierarchical_separator);
          if (name) {
            name += ' | ';
          }
          name += components[components.length - 1];
        }
        for (j = 0; j < components.length - 1; j++) {
          found = false;
          for (k = 0; k < branch.children.length; k++) {
            if (branch.children[k].name === components[j]) {
              found = true;
              branch = branch.children[k];
              break;
            }
          }
          if (! found) {
            console.warn('CDNHorizontalTable: Hierarchy has missing elements - not adding '+keys[0]+' to treemap');
            continue nextRow;
          }
        }
        child = {
          name: name,
          fullName: fullName,
          children: [],
          comparisons: []
        };
        branch.children.push(child);
        allValues[i].map(function(value, i) {
          var rawValue = 0;
          if (value.defined && value.number) {
            rawValue = value.rawValue;
          }
          if (i === goldCol) {
            child.size = rawValue;
            if (branch === data) {
              data.size += rawValue;
            }
          } else {
            child.comparisons.push(value.defined && value.number ? rawValue : undefined);
            if (branch === data) {
              if (! data.comparisons[i]) {
                data.comparisons[i] = 0;
              }
              data.comparisons[i] += rawValue;
            }
          }
        });
      }
    } else {
      for (i = 0; i < allValues.length; i++) {
        keys = this.keyNames[i % this.keyNames.length].split("\n");
        if (this.config.per_snapshot) {
          name = fullName.split("\n")[0];
        } else {
          name = '';
        }
        if (keys.length) {
          if (name) {
            name += ' | ';
          }
          name += keys.map(function(key) {return key.replacements.join(' | ');}).join(' | ');
        }
        child = {
          name: name,
          fullName: name,
          children: [],
          comparisons: []
        };
        data.children.push(child);
        allValues[i].map(function(value, i) {
          var rawValue = 0;
          if (value.defined && value.number) {
            rawValue = value.rawValue;
          }
          if (i === goldCol) {
            child.size = rawValue;
            data.size += rawValue;
          } else {

    <script type="text/javascript">'use strict';

  function colorToRgba(definition) {
    if (!definition) {
      return undefined;
    }
    definition = '' + definition;
    if (definition.charAt(0) === '#') {
      definition = definition.match(/[0-9A-Fa-f]{2}/g);
      definition = definition.map(function(hex) {
        return parseInt(hex, 16);
      });
    } else {
      definition = definition.split(' ');
      definition = definition.map(function(val) {
        return +val;
      });
    }
    if (!definition.every(function(val) {
      return (val >= 0 && val < 256);
    })) {
      return undefined;
    }
    if (definition.length === 3) {
      return 'rgb('+definition.join(',')+')';
    } else if (definition.length === 4) {
      definition[3] = definition[3] / 255;
      return 'rgba('+definition.join(',')+')';
    } else {
      return undefined;

  CDNHistogram.prototype.renderGraph = function() {

      polygon.setAttributeNS(null, 'stroke', color || 'none');

    svg.setAttributeNS(null, 'width', width);

    // draw labels

      x = 50 + ((perLabelGap + (comparisonCount * perComparison) + ((comparisonCount - 1) * perComparisonGap)) * i) + (perLabelGap/2);

        for (k = 0; k < series.length; k++) {

          if (value && value.value > 0) {

    labelMax = 20;
    for (i = series.length - 1; i >= 0; i--) {
      drawRect(undefined, CDNColor.get(i), x, labelMax, x + 10, labelMax + 10);
      drawText('#000', series[i], false, x + 15, labelMax + 8).setAttributeNS(null, 'class', 'pie-slice-label');
      labelMax += 12;
    }

    // axis labels
    if (this.xAxisLabel) {
      drawText('#000', this.xAxisLabel, true, width - 115, height - 5);
    }
    if (this.yAxisLabel) {
      drawText('#000', this.yAxisLabel, true, 10, 5, 270);
    }

    // title
    if (this.config.metric.title) {
      drawText('#000', this.config.metric.title, false, width/2, -10).setAttributeNS(null, 'text-anchor', 'middle');
    }

  };

  CDNHistogram.prototype.setPopover = function(event) {

  CDNHistogram.prototype.parseHistogramData = function(description) {
    var value, name;

    if (! description.defined) {
      return undefined;
    }

    value = CDNHelpers.parseTclDict(description.rawValue);
    if (! value || CDNHelpers.isEmpty(value)) {
      return undefined;
    }
    if (value.labels) {
      value.labels = CDNHelpers.parseTclList(value.labels);
    } else {
      value.labels = [];
    }
    if (value.series) {
      value.series = CDNHelpers.parseTclDict(value.series);
    } else {
      value.series = {};
    }

    for (name in value.series) {
      if (value.series[name]) {
        value.series[name] = CDNHelpers.parseTclDict(value.series[name]);
        if (value.series[name] && ! CDNHelpers.isEmpty(value.series[name])) {
          // TODO: parse color values
          if (value.series[name].values) {
            value.series[name].values = CDNHelpers.parseTclList(value.series[name].values).map(function(n){return parseFloat(n, 10);});
          } else {
            value.series[name].values = [];
          }
        } else {
          value.series[name] = undefined;
        }
      } else {
        value.series[name] = undefined;
      }
    }
    return value;
  };

    if (! (this.maxWidth >= 0)) this.maxWidth = 512;
    if (! (this.minHeight >= 0)) this.minHeight = 128;
    if (! (this.maxHeight >= 0)) this.maxHeight = 512;

        m.getValueDescriptions(intermediateCallback);

  CDNImagePlot.prototype.computeImagePlotData = function(snapshots) {
    var path, parsedValues, mergedValues, metrics, i, comparisons, j, data, sequencer, descriptions, bounds, testBounds, merged;

    function pullLayers(layer, name, path) {
      var layers, childLayers, key, childKey, uri;
      if (!layer) {return {};}
      if (!name) {name = '';}
      if (!path) {path = '';}
      uri = path + '/' + name;
      layers = {};
      if (name) {
        layers[uri] = {};
      }
      if (layer.data) {
        layers[uri].fill = layer.fill || 'transparent';
        layers[uri].stroke = layer.stroke || 'transparent';

      sequencer = new CDNHelpers.SequenceCombiner();

        for (i = 0; i < metrics.length; i++) {
          comparisons = metrics[i];
          for (j = 0; j < comparisons.length; j++) {
            found = pullLayers(comparisons[j]);
            for (name in found) {
              layerData[name] = found[name];
            }
            layers = sequencer.mergeWith(CDNHelpers.keys(found));
          }

          }
        }

        } else {

        children: {},

          if (now && now.data) {
            return prev.concat(now.data);
          } else {
            return prev;
          }
        }, []);
        result.fill = level.reduce(function(prev, now) {
          if (now && now.fill) {
            return now.fill;
          } else {
            return prev;
          }
        }, undefined);
        result.stroke = level.reduce(function(prev, now) {
          if (now && now.stroke) {

          }

        if (layer.data) {

            obj = layer.data[i];

                if (obj.y < bounds.y0) {bounds.y0 = obj.y;}
                if (obj.x + obj.width > bounds.x1) {bounds.x1 = obj.x + obj.width;}
                if (obj.y + obj.height > bounds.y1) {bounds.y1 = obj.y + obj.height;}
                break;

                if (obj.cy - obj.r < bounds.y0) {bounds.y0 = obj.cy - obj.r;}
                if (obj.cx + obj.r > bounds.x1) {bounds.x1 = obj.cx + obj.r;}

                  if (obj.points[j] > bounds.x1) {bounds.x1 = obj.points[j];}

        for (j = 0; j < comparisons.length; j++) {

          if (testBounds.x0 < bounds.x0) {

          if (testBounds.y0 < bounds.y0) {

    } else {

  };

  CDNImagePlot.prototype.parseImagePlotData = function(description) {
    var value, name;

    function parsePathData(value) {
      var paths, i, j, type, points, obj, withValue;
      paths = [];
      withValue = false;
      // Make the path easy to consume by turning all sequences of comma and
      // whitespace into a single space character.
      value = ('' + value).replace(/[\s,]+/g, ' ');
      // Make sure there are spaces around sequences of A-Za-z
      value = value.replace(/([^\s^])([A-Za-z]+)/g, function(match, before, op) {
        return before + ' ' + op;
      });
      value = value.replace(/([A-Za-z]+)([^\s$])/g, function(match, op, after) {
        return op + ' ' + after;
      });
      // We can now easily tokenize by splitting on space
      value = value.trim().split(' ').map(function(v) {
        // Convert strings which look like numbers into numbers
        if (v === "") {
          return undefined;
        } else if ((+v) == v) {
          return (+v);
        } else {
          return v;
        }
      });
      value = value.filter(function(v) {
        return v !== undefined;
      });
      // Build up our parsed objects from the tokens
      for (i = 0; i < value.length;) {

        if (('' + value[i]) === value[i]) {

            case 'R':
              type = 'rectangle';
              break;
            case 'B':
              type = 'box';
              break;
            case 'G':
              type = 'polygon';
              break;
            case 'L':
              type = 'polyline';
              break;
            case 'C':
              type = 'circle';
              break;
            case 'P':
              type = 'point';
              break;
            default:
              console.error('Unknown type for ImagePlot: '+value[i].charAt(0));
              type = undefined;
              break;
          }
          withValue = (value[i].charAt(1) === 'V');
          i += 1;
        }
        if (! type) {
          // skip to the next type marker
          for (j = i; j < value.length; j++) {
            if (('' + value[j]) === value[j]) {
              i = j;
              type = true;
              break;
            }
          }
          if (type) {
            continue;
          }
          break;
        }
        obj.type = type;
        switch (type) {
          case 'rectangle':
            obj.x = value[i];
            obj.y = value[i + 1];
            obj.width = value[i + 2];
            obj.height = value[i + 3];
            i += 4;
            break;
          case 'box':
            obj.type = 'rectangle';
            obj.x = value[i];
            obj.y = value[i + 1];
            obj.width = value[i + 2] - obj.x;
            obj.height = value[i + 3] - obj.y;
            i += 4;
            break;
          case 'circle':
            obj.cx = value[i];
            obj.cy = value[i + 1];
            obj.r = value[i + 2];
            i += 3;
            break;
          case 'point':
            obj.cx = value[i];
            obj.cy = value[i + 1];
            i += 2;
            break;
          case 'polygon':
          case 'polyline':
            // find the end of the polygon/polyline
            for (j = i + 1; j < value.length; j++) {
              if (('' + value[j]) === value[j]) {
                break;
              }
            }
            if (withValue) {
              j--;
            }
            obj.points = value.slice(i, j);
            i = j;
            break;
          default:
            console.error('Unhandled type for ImagePlot: '+value[i].charAt(0));
            // This results in infinite loops
            return;
        }
        if (withValue) {
          obj.value = value[i];
          i += 1;
        }
        paths.push(obj);
      }
      return paths;
    }

    function parseNestedData(value) {
      var key;
      if (! value || CDNHelpers.isEmpty(value)) {
        return undefined;
      }
      if (value.data != undefined) {
        value.data = parsePathData(value.data);
        if (value.fill_color) {
          value.fill = colorToRgba(value.fill_color);
          delete value.fill_color;
        }
        if (value.stroke_color) {
          value.stroke = colorToRgba(value.stroke_color);
          delete value.stroke_color;
        }
      } else {
        for (key in value) {
          value[key] = parseNestedData(CDNHelpers.parseTclDict(value[key]));
        }
      }
      return value;
    }

    if (! description || ! description.defined) {
      return undefined;
    }

    value = parseNestedData(CDNHelpers.parseTclDict(description.rawValue));
    return value;
  };

  CDNDataCell.renderValue = function(value, targetUnits) {
    var rawValue, number, unitMatch, units;

    function multi(siPrefix) {
      if (siPrefix.length < 2) {
        return 1;
      }
      switch (siPrefix.substr(0, 1)) {
        case 'Y': return 1e24;
        case 'Z': return 1e21;
        case 'E': return 1e18;
        case 'P': return 1e15;
        case 'T': return 1e12;
        case 'G': return 1e9;
        case 'M': return 1e6;
        case 'k': return 1e3;
        case 'h': return 1e2;
        case 'd': return 1e-1;
        case 'c': return 1e-2;
        case 'm': return 1e-3;
        case 'u': return 1e-6;
        case 'n': return 1e-9;
        case 'p': return 1e-12;
        case 'f': return 1e-15;
        case 'a': return 1e-18;
        case 'z': return 1e-21;
        case 'y': return 1e-24;
        default:  return 1;
      }
    }

    function sameBaseUnit(a, b) {
      var aBase, bBase;
      // Test we have non-empty strings
      if (! a || ! b || (''+a) !== a || (''+b) !== b) {
        return false;
      }
      a = a.toUpperCase();
      b = b.toUpperCase();
      aBase = a.substr(1);
      bBase = b.substr(1);
      if (a === b) {return true;}
      if (aBase === b) {return true;}
      if (a === bBase) {return true;}
      if (aBase === bBase) {return true;}
      return false;
    }

    rawValue = value;
    number = false;

    // Value looks like a float (matches 3.5, 3e5, 3.5E-7 but not integers)
    if (value && (''+value)===value && value.match(/^[-\+]?[0-9]+(\.[0-9]+|(\.[0-9]+)?[eE][-\+]?[0-9]+)(\s|$)/)) {
      rawValue = parseFloat(value, 10);
      number = true;

    // Value looks like an integer
    } else if (value && (''+value)===value && value.match(/^[-\+]?[0-9]+(\s|$)/)) {
      rawValue = parseInt(value, 10);
      number = true;
    }

    // Defend against parseInt/parseFloat failing
    if (isNaN(rawValue)) {
      rawValue = value;
      number = false;
    }

    if (number) {
      unitMatch = value.match(/^[0-9\-\+\.eE]+\s+(.+)/);
      units = "";
      if (unitMatch && unitMatch[1]) {
        units = unitMatch[1];
      }
      if (targetUnits === '%') {
        if (units !== '%') {
          rawValue *= 100;
        }
      } else {
        // Pull the units off the end of the value
        if (units && targetUnits && sameBaseUnit(units, targetUnits)) {
          // Multiply the value so we compare the same units
          rawValue *= multi(units) / multi(targetUnits);
        }
      }
    }

    return {
      rawValue: rawValue,
      isNumber: number,
      units: units
    };
  };

  CDNDataCell.renderSeconds = function(value, precision) {
    var toFixed = false, time, minutes, seconds;
    if (precision !== undefined) {
      toFixed = true;
    }
    // Hours
    time = [Math.floor(value / 3600)];
    // Minutes
    minutes = Math.floor((value % 3600) / 60);
    if (minutes < 10) {
      time.push('0' + minutes);
    } else {
      time.push(minutes);
    }
    // Seconds
    seconds = value % 60;
    if (toFixed) {
      seconds = seconds.toFixed(precision);
    }
    if (seconds < 10) {
      time.push('0' + seconds);
    } else {
      time.push(seconds);
    }
    return time.join(':');
  };

  CDNDataCell.numberWithCommas = function(x) {
    var parts = x.toString().split(".");
    parts[0] = parts[0].replace(/\B(?=(\d{3})+(?!\d))/g, ",");
    return parts.join(".");
  };

  /* Value normalizer for CDNMetricComparison */
  CDNDataCell.normalize = function(metric, metricConfig, description) {
    var rendered, rawThreshold;
    // _name_ metric does not have a metricConfig so we cannot assume one exists
    description.rawUnits = metricConfig ? metricConfig.units || '' : '';
    if (metric) {
      rendered = CDNDataCell.renderValue(metric.value, description.rawUnits);
    }
    rawThreshold = 0;
    if (metricConfig && metricConfig.threshold) {
      // Turn our threshold into a number
      rawThreshold = CDNDataCell.renderValue(metricConfig.threshold, description.rawUnits);
      description.threshold = rawThreshold;
      if (rawThreshold.isNumber) {
        rawThreshold = rawThreshold.rawValue;
        // Make sure the threshold is positive
        if (rawThreshold < 0) { rawThreshold *= -1 }
      } else {
        rawThreshold = 0;
      }
    }
    description.rawThreshold = rawThreshold;
    if (metric) {
      description.number = rendered.isNumber;
      description.rawValue = rendered.rawValue;
      description.inherited = metric.inherited;
    }
    if (description.number && description.rawUnits === 's') {
      description.renderedValue = CDNDataCell.renderSeconds(description.rawValue, metricConfig && metricConfig.dp || 0);
    } else if (description.number) {
      description.renderedValue = CDNDataCell.numberWithCommas(description.rawValue.toFixed(metricConfig && metricConfig.dp || 0));
    } else {
      description.renderedValue = description.rawValue === undefined ? '' : description.rawValue;
    }
    return description.rawValue;
  };

  window.CDNDataCell = CDNDataCell;

  window.CDNMetricComparison.registerCellRenderer(undefined, CDNDataCell);
})();

(function() {

  function CDNBooleanCell(metricComparison) {
    this.extended.apply(this, arguments);
  }
  CDNHelpers.extend(CDNCellRenderer, CDNBooleanCell);

  CDNBooleanCell.prototype.renderCellContents = function() {
    var i, length, value, imgContainer;

    for (i = 0; i < this.values.length; i++) {
      if (! this.cells[i * 2]) { continue; }
      this.cells[(i * 2) + 1].style.display = 'none';
      this.cells[i * 2].colSpan = 2;
      CDNHelpers.removeChildren(this.cells[i * 2]);

      if (this.values[i].defined) {
        imgContainer = document.createElement('div');
        imgContainer.className = 'cdn-boolean-cell-image';
        /* coerce the value to a boolean, following js and tcl rules ('0' = false,
         * 'false' = false) */
        imgContainer.setAttribute('data-boolean-value', this.values[i].rawValue ? 'pass' : 'fail');
        imgContainer.alt = this.values[i].rawValue ? 'Pass' : 'Fail';
        this.cells[i * 2].appendChild(imgContainer);
      }

      this.cells[i * 2].setAttribute('data-metric', this.values[i].name);
      this.cells[i * 2].title = '';
      if (! this.values[i].singleMetric) {
        if (this.values[i].gold) {
          this.cells[i * 2].setAttribute('data-metric-compare', 'gold');
        } else {
          this.cells[i * 2].setAttribute('data-metric-compare', this.values[i].relation);
        }
      } else if (this.pageConfig.color_met_target || this.values[i].targetRelation === CDNMetricComparison.BAD || this.values[i].targetRelation === CDNMetricComparison.WARNING) {
        this.cells[i * 2].setAttribute('data-metric-compare', this.values[i].targetRelation);
        switch (CDNMetricComparison.resolveComparison(this.values[i].cmp)) {
        case CDNMetricComparison.CMP_LARGER:
        case CDNMetricComparison.CMP_LARGER_LIMITED:
          this.cells[i * 2].title = 'Below target of '+this.values[i].target;
          break;
        case CDNMetricComparison.CMP_SMALLER:
        case CDNMetricComparison.CMP_SMALLER_LIMITED:
          this.cells[i * 2].title = 'Above target of '+this.values[i].target;
          break;
        }
      } else {
        this.cells[i * 2].removeAttribute('data-metric-compare');
      }
    }
  };


  /* Value normalizer for CDNMetricComparison */
  CDNBooleanCell.normalize = function(metric, metricConfig, description) {
    var value, pass;
    value = metric ? metric.value : metric.rawValue;
    if (value === undefined) {
      return undefined;
    }
    // Coerce to boolean,
    // Take 'false' as false.
    // If value is a number then coerce to number, then to boolean ('0' is false)
    pass = !! value && value !== 'false' && isNaN(value) || !! +value;
    return pass;
  };

  window.CDNBooleanCell = CDNBooleanCell;

  window.CDNMetricComparison.registerCellRenderer('bool', CDNBooleanCell);

})();

(function() {

  function CDNAlertCell(metricComparison) {
    this.extended.apply(this, arguments);
    this.className = 'cdn-alert-cell-renderer';
  }
  CDNHelpers.extend(CDNDataCell, CDNAlertCell);

  CDNAlertCell.prototype.setPopover = function(index, event) {
    // Disable the hover popup
  };

  CDNAlertCell.prototype.fillValueCell = function(valueCell, index, value) {
    var i, ul, li;
    CDNHelpers.removeChildren(valueCell);
    ul = document.createElement('ul');
    if (! value.renderedValue) {
      return;
    }
    valueCell.appendChild(ul);
    for (i = 0; i < value.renderedValue.length; i++) {
      li = document.createElement('li');
      li.textContent = value.renderedValue[i];
      ul.appendChild(li);
    }
  };

  /* Value normalizer for CDNMetricComparison */
  CDNAlertCell.normalize = function(metric, metricConfig, description) {
    var list, keys, key, i, ordered;
    description.number = false;
    if (metric) {
      description.inherited = metric.inherited;
    }
    if (description.rawValue) {
      list = CDNHelpers.parseTclDict(description.rawValue);
      // Sort by key alphabetically so that we compare like for like
      keys = CDNHelpers.keys(list).sort();
      ordered = {};
      description.rawValue = [];
      for (i = 0; i < keys.length; i++) {
        key = keys[i];
        ordered[key] = list[key];
        description.rawValue.push('{'+key+'}', '{'+list[key]+'}');
      }
      description.rawValue = description.rawValue.join(' ');
      description.renderedValue = CDNHelpers.values(ordered);
    }
    return description.rawValue;
  };

  window.CDNAlertCell = CDNAlertCell;

  window.CDNMetricComparison.registerCellRenderer('alert', CDNAlertCell);

})();

(function() {

  function CDNMessagesCell(metricComparison) {
    this.extended.apply(this, arguments);
    this.className = 'cdn-messages-cell-renderer';
  }
  CDNHelpers.extend(CDNDataCell, CDNMessagesCell);

  CDNMessagesCell.prototype.setPopover = function(index, event) {
    // Disable the hover popup
  };

  CDNMessagesCell.prototype.applyCells = function(cells) {
    var that = this, i;

    function addMouseHandler(cell, index) {
      cell.addEventListener('click', that.openPopup.bind(that, index));
    }

    this.extended.prototype.applyCells.apply(this, arguments);

    for (i = 0; i < this.cells.length; i++) {
      addMouseHandler(this.cells[i], i);
    }

    return this.cells;
  };

  CDNMessagesCell.prototype.renderCellContents = function() {
    var valueCell, deltaCell, i;

    this.applyCustomComparison(this.values);

    this.extended.prototype.renderCellContents.apply(this, arguments);

    if (this.values.length === 1) {
      valueCell = this.cells[0];
      deltaCell = this.cells[1];
      if (this.values[0].errorCount > 0) {
        valueCell.setAttribute('data-metric-compare', CDNMetricComparison.BAD);
        deltaCell.setAttribute('data-metric-compare', CDNMetricComparison.BAD);
      } else if (this.values[0].warningCount > 0) {
        valueCell.setAttribute('data-metric-compare', CDNMetricComparison.GOLD);
        deltaCell.setAttribute('data-metric-compare', CDNMetricComparison.GOLD);
      }
    }
  };

  CDNMessagesCell.prototype.applyCustomComparison = function(values) {
    var i, gold, value, worstError, worstWarning, worstDifference;
    if (values.length > 1) {
      gold = values[values.length - 1];
      for (i = 0; i < values.length - 1; i++) {
        value = values[i];
        if (! value.defined || ! gold.defined) {
          value.relation = CDNMetricComparison.NEUTRAL;
          continue;
        }
        // Look at error count
        worstError = CDNHelpers.values(this.extractDifference(value.errorIdCount, gold.errorIdCount)).reduce(function(previous, value) {
          return Math.max(previous, value);
        }, -Infinity);
        worstWarning = CDNHelpers.values(this.extractDifference(value.warningIdCount, gold.warningIdCount)).reduce(function(previous, value) {
          return Math.max(previous, value);
        }, -Infinity);
        worstDifference = Math.max(worstError, worstWarning);
        if (worstDifference > -Infinity && worstDifference !== 0) {
          if (worstDifference > 0) {
            value.relation = CDNMetricComparison.BAD;
          } else {
            value.relation = CDNMetricComparison.GOOD;
          }
        } else {
          value.relation = CDNMetricComparison.NEUTRAL;
        }
      }
    }
  };

  CDNMessagesCell.prototype.extractDifference = function(value, gold) {
    var differences, key;
    differences = {};
    for (key in value) {
      if (key in gold) {
        if (value[key] !== gold[key]) {
          differences[key] = value[key] - gold[key];
        }
      } else {
        differences[key] = value[key];
      }
    }
    for (key in gold) {
      if (!(key in value)) {
        differences[key] = -gold[key];
      }
    }
    return differences;
  };

  CDNMessagesCell.prototype.fillValueCell = function(valueCell, index, value) {
    var errorSpan, warningSpan;
    CDNHelpers.removeChildren(valueCell);
    if (! value.defined) {
      return;
    }
    errorSpan = document.createElement('span');
    errorSpan.textContent = 'e:'+value.errorCount;
    if (value.errorCount > 0) {
      errorSpan.setAttribute('data-cdn-messages-has-errors', 'yes');
    }
    valueCell.appendChild(errorSpan);
    warningSpan = document.createElement('span');
    warningSpan.textContent = 'w:'+value.warningCount;
    if (value.warningCount > 0) {
      warningSpan.setAttribute('data-cdn-messages-has-warnings', 'yes');
    }
    valueCell.appendChild(warningSpan);
  };

  CDNMessagesCell.prototype.openPopup = function(index) {
    var value, table, tr, td, i, j, props, message, modal;
    value = this.values[Math.floor(index / 2)];

    table = document.createElement('table');
    table.className = 'cdn-messages-table';
    tr = document.createElement('tr');
    table.appendChild(tr);
    props = ['Type', '#num', 'Msg ID', 'Message'];
    for (i = 0; i < props.length; i++) {
      td = document.createElement('th');
      td.textContent = props[i];
      tr.appendChild(td);
    }
    props = ['severity', 'count', 'id', 'short'];
    for (i = 0; i < value.renderedValue.length; i++) {
      tr = document.createElement('tr');
      table.appendChild(tr);
      message = value.renderedValue[i];
      for (j = 0; j < props.length; j++) {
        td = document.createElement('td');
        td.textContent = message[props[j]];
        td.className = 'cdn-messages-table-'+props[j];
        tr.appendChild(td);
      }
    }

    modal = new CDNModal(table);
    modal.show();
  };

  /* Value normalizer for CDNMetricComparison */
  CDNMessagesCell.normalize = function(metric, metricConfig, description) {
    var list, i, ordered;
    description.number = false;
    if (metric) {
      description.inherited = metric.inherited;
    }
    list = CDNHelpers.parseTclList(description.rawValue).map(CDNHelpers.parseTclDict).map(function(message) {
      if (message.severity) {
        message.severity = ('' + message.severity).toLowerCase()
      }
      return message;
    });
    description.errorCount = 0;
    description.warningCount = 0;
    description.errorIdCount = {};
    description.warningIdCount = {};
    list.map(function(message) {
      switch (message.severity) {
        case 'error':
          description.errorCount += +message.count;
          if (! description.errorIdCount[message.id]) {
            description.errorIdCount[message.id] = 0;
          }
          description.errorIdCount[message.id] += +message.count;
          break;
        case 'warning':
        case 'warn':
          description.warningCount += +message.count;
          if (! description.warningIdCount[message.id]) {
            description.warningIdCount[message.id] = 0;
          }
          description.warningIdCount[message.id] += +message.count;
          break;
      }
    });
    ordered = list.sort(function(a, b) {
      if (a.severity !== b.severity) {
        if (a.severity === 'error') {
          return -1;
        } else if (b.severity === 'error') {
          return 1;
        } else if (a.severity === 'warning' || a.severity === 'warn') {
          return -1;
        } else if (b.severity === 'warning' || b.severity === 'warn') {
          return 1;
        }
      }
      if (a.id > b.id) {
        return 1;
      } else if (a.id < b.id) {
        return -1;
      } else {
        return 0;
      }
    });
    description.renderedValue = ordered;
    return description.rawValue;
  };

  window.CDNMessagesCell = CDNMessagesCell;

  window.CDNMetricComparison.registerCellRenderer('messages', CDNMessagesCell);

})();

  CDNImageCell.prototype.fillValueCell = function(valueCell, index, value, url) {

(function() {

  function CDNHtmlCell(metricComparison) {
    this.metricConfig = undefined;
    CDNCellRenderer.apply(this, arguments);

    if (metricComparison) {
      this._renderCellContentsBound = this.renderCellContents.bind(this);
      CDNHelpers.events.add('cdnpresentationchanged', this._renderCellContentsBound);

  }
  CDNHelpers.extend(CDNCellRenderer,CDNHtmlCell);

  CDNHtmlCell.prototype.finalize = function() {
    CDNHelpers.events.remove('cdnpresentationchanged', this._renderCellContentsBound);
  };

  CDNHtmlCell.prototype.applyCells = function(cells, pageConfig) {
    var i, length, cell, calls;

    this.pageConfig = pageConfig;
    this.cells = cells;

    if (this.className) {
      for (i = 0; i < this.cells.length; i++) {
        this.cells[i].className = this.className;
      }
    }

    calls = [
      this.metricComparison.getValueDescriptions.bind(this.metricComparison),
      this.metricComparison.getMetricConfig.bind(this.metricComparison)

    CDNHelpers.waitForAll(calls, function(call, intermediateCallback) {

  CDNHtmlCell.prototype.valuesUpdated = function(callReturns) {

    this.metricConfig = callReturns[1];

  CDNHtmlCell.prototype.renderCellContents = function() {
    var i, showPercent, valueCell, deltaCell;

    showPercent = cdnPage.getDeltaPresentationMode() === 'percentDiff';

    for (i = 0; i < this.values.length; i++) {
      valueCell = this.cells[i * 2];
      deltaCell = this.cells[(i * 2) + 1];
      if (! valueCell) { continue; }
      this.fillValueCell(valueCell, i, this.values[i]);
      if (! this.values[i].gold && this.values[i].percentDiff !== '') {
        deltaCell.className = 'cdn-metric-delta';
        this.fillDeltaCell(deltaCell, i, this.values[i], showPercent);
        deltaCell.style.display = '';
        valueCell.colSpan = 1;
        valueCell.setAttribute('data-has-delta-cell', 'yes');

        deltaCell.style.display = 'none';
        valueCell.removeAttribute('data-has-delta-cell', 'yes');

      valueCell.title = '';
      deltaCell.title = '';
      if (! this.values[i].singleMetric) {

          valueCell.setAttribute('data-metric-compare', 'gold');
          deltaCell.setAttribute('data-metric-compare', 'gold');
        } else {
          valueCell.setAttribute('data-metric-compare', this.values[i].relation);
          deltaCell.setAttribute('data-metric-compare', this.values[i].relation);
        }
      } else if (this.pageConfig.color_met_target || this.values[i].targetRelation === CDNMetricComparison.BAD || this.values[i].targetRelation === CDNMetricComparison.WARNING) {
        valueCell.setAttribute('data-metric-compare', this.values[i].targetRelation);
        deltaCell.setAttribute('data-metric-compare', this.values[i].targetRelation);
        switch (CDNMetricComparison.resolveComparison(this.values[i].cmp)) {
        case CDNMetricComparison.CMP_LARGER:
        case CDNMetricComparison.CMP_LARGER_LIMITED:
          valueCell.title = 'Below target of '+this.values[i].target;
          deltaCell.title = 'Below target of '+this.values[i].target;
          break;
        case CDNMetricComparison.CMP_SMALLER:
        case CDNMetricComparison.CMP_SMALLER_LIMITED:
          valueCell.title = 'Above target of '+this.values[i].target;
          deltaCell.title = 'Above target of '+this.values[i].target;
          break;
        }
      } else {
        valueCell.removeAttribute('data-metric-compare');
        deltaCell.removeAttribute('data-metric-compare');
      }
      valueCell.setAttribute('data-metric', this.values[i].name);
      valueCell.setAttribute('data-metric-value-type', this.values[i].number ? 'number' : 'string');
      deltaCell.setAttribute('data-metric', this.values[i].name);
      deltaCell.setAttribute('data-metric-value-type', this.values[i].number ? 'number' : 'string');
      if (this.metricConfig && this.metricConfig.type) {
        valueCell.setAttribute('data-metric-type', this.metricConfig.type);
        deltaCell.setAttribute('data-metric-type', this.metricConfig.type);
      } else {

        deltaCell.removeAttribute('data-metric-type');

  };

  CDNHtmlCell.prototype.fillValueCell = function(valueCell, index, value) {

    valueCell.innerHTML = value.renderedValue.replace(/<((?:script|style|embed|object)[ >])/g, '< $1');
  };

  CDNHtmlCell.prototype.fillDeltaCell = function(deltaCell, index, value, showPercent) {
    var span;
    CDNHelpers.removeChildren(deltaCell);
    span = document.createElement('span');

  CDNHtmlCell.renderValue = function(value, targetUnits) {
    var rawValue, number, unitMatch, units;

    function multi(siPrefix) {
      if (siPrefix.length < 2) {
        return 1;
      }
      switch (siPrefix.substr(0, 1)) {
        case 'Y': return 1e24;
        case 'Z': return 1e21;
        case 'E': return 1e18;
        case 'P': return 1e15;
        case 'T': return 1e12;
        case 'G': return 1e9;
        case 'M': return 1e6;
        case 'k': return 1e3;
        case 'h': return 1e2;
        case 'd': return 1e-1;
        case 'c': return 1e-2;
        case 'm': return 1e-3;
        case 'u': return 1e-6;
        case 'n': return 1e-9;
        case 'p': return 1e-12;
        case 'f': return 1e-15;
        case 'a': return 1e-18;
        case 'z': return 1e-21;
        case 'y': return 1e-24;
        default:  return 1;
      }
    }

    rawValue = value;
    number = false;

    // Value looks like a float (matches 3.5, 3e5, 3.5E-7 but not integers)
    if (value && (''+value)===value && value.match(/^[-\+]?[0-9]+(\.[0-9]+|(\.[0-9]+)?[eE][-\+]?[0-9]+)(\s|$)/)) {
      rawValue = parseFloat(value, 10);
      number = true;

    // Value looks like an integer
    } else if (value && (''+value)===value && value.match(/^[-\+]?[0-9]+(\s|$)/)) {
      rawValue = parseInt(value, 10);
      number = true;
    }

    if (isNaN(rawValue)) {
      rawValue = value;
      number = false;
    }

    if (number) {
      if (targetUnits === '%') {
        rawValue *= 100;
      } else {
        // Pull the units off the end of the value
        unitMatch = value.match(/^[0-9\-\+\.eE]+\s+(.+)/);
        if (unitMatch && unitMatch[1]) {
          units = unitMatch[1];

          rawValue *= multi(units) / multi(targetUnits);
        }
      }
    }

    return {
      rawValue: rawValue,
      isNumber: number
    };
  };

  CDNHtmlCell.normalize = function(metric, metricConfig, description) {
    var rendered, rawThreshold
    // _name_ metric does not have a metricConfig so we cannot assume one exists
    description.rawUnits = metricConfig ? metricConfig.units || '' : '';
    if (metric) {
      rendered = CDNHtmlCell.renderValue(document.createRange().createContextualFragment(metric.value), description.rawUnits);
    }
    rawThreshold = 0;
    if (metricConfig && metricConfig.threshold) {
      // Turn our threshold into a number
      rawThreshold = CDNHtmlCell.renderValue(metricConfig.threshold, description.rawUnits);
      if (rawThreshold.isNumber) {
        rawThreshold = rawThreshold.rawValue;
        // Make sure the threshold is positive
        if (rawThreshold < 0) { rawThreshold *= -1 }
      } else {

      }
    }
    description.rawThreshold = rawThreshold;
    if (metric) {
      description.number = rendered.isNumber;
      description.rawValue = rendered.rawValue;
      description.inherited = metric.inherited;
    }
    description.renderedValue = metric.value;
    return description.rawValue;
  };

  window.CDNHtmlCell = CDNHtmlCell;

  window.CDNMetricComparison.registerCellRenderer('html', CDNHtmlCell);
})();

(function() {

  function CDNSlackCell(metricComparison) {

  CDNSlackCell.prototype.fillValueCell = function(valueCell, index, value) {

      // Our timing metric will follow the format:
      //   timing.setup.wns.view:view.group:group
      //   timing.hold.tns.group:group
      //   timing.setup.wns
      // Paths are at:
      //   timing.setup.paths.view:view.group:group
      //   timing.hold.paths.group:group
      //   timing.setuo.paths
      // Histograms are at:
      //   timing.setup.histogram
      //   timing.hold.histogram
      // Split on not-escaped period
      parts = this.metricComparison.metric.split(/(?:\\\\)*\./);
      rootPrefix = parts.slice(0, 2).join('.');
      viewGroup = parts.slice(3).join('.');
      if (viewGroup) {
        viewGroup = '.' + viewGroup
      }
      cdnDataManager.getComparableThings(function(things) {
        var a, newPath, newRun, rootPath, subIndex;
        // GOLD POSITION
        things.unshift(things.pop());
        if (things[index] && things[index].metrics) {
          rootPath = cdnDataManager.getComparisonPath().split('/').filter(function(p) {return !!p;})
          switch (cdnDataManager.getComparisonMethod()) {
            case cdnDataManager.COMPARE_RUNS:
              newRun = cdnDataManager.getRunIds();
              // GOLD POSITION
              newRun.unshift(newRun.pop());
              newRun = newRun[index];
              newPath = rootPath.slice();
              if (this.metricComparison.subpath) {newPath = newPath.concat(this.metricComparison.subpath.split('/'))}
              if (this.metricComparison.secondarySubpath) {newPath = newPath.concat(this.metricComparison.secondarySubpath.split('/'))}
              break;
            case cdnDataManager.COMPARE_TESTSUITES:
              newRun = things[index].id;
              newPath = rootPath.slice();
              if (this.metricComparison.secondarySubpath) {newPath = this.metricComparison.secondarySubpath.split('/')}
              break;
            case cdnDataManager.COMPARE_HISTORY:
              newRun = this.metricComparison.subpath;
              newPath = [];
              break;
          }
          newPath = newPath.filter(function(p) {return !!p;});
          newPath = newPath.join('/');

              run: newRun,
              testsuite: undefined,
              history: undefined,
              run_header: undefined,
              timing_prefix: rootPrefix,
              timing_group: viewGroup

(function() {

  function CDNHistogramCell(metricComparison) {
    this.metricConfig = undefined;
    CDNCellRenderer.apply(this, arguments);
    this.className = 'cdn-histogram-cell';
    if (metricComparison) {
      this.popover = document.createElement('div');
      this.popover.className = 'cdn-histogram-popover';
      this.popoverText = document.createElement('div');
      this.popover.appendChild(this.popoverText);
    }
  }
  CDNHelpers.extend(CDNCellRenderer,CDNHistogramCell);

  CDNHistogramCell.no_wildcard_expansion = true;

  CDNHistogramCell.prototype.applyCells = function(cells, pageConfig) {
    var i, filteredAll, filteredRow, filteredConfigs, minComparison, maxComparison, regexp;

    this.pageConfig = pageConfig;
    this.cells = cells;

    if (this.className) {
      for (i = 0; i < this.cells.length; i++) {
        this.cells[i].className = this.className;
      }
    }
    for (i = 0; i < this.cells.length; i++) {
      if (i % 2 === 0) {
        this.cells[i].colSpan = 2;
      } else {
        // Don't need any delta cells
        this.cells[i].style.display = 'none';
      }
    }

    if (this.metricComparison instanceof CDNMetricSummaryComparison) {
      for (i = 0; i < this.cells.length; i += 2) {
        CDNHelpers.removeChildren(this.cells[i]);
      }
      return cells;
    }

    regexp = false;
    if (this.metricComparison.metric) {
      regexp = new RegExp(this.metricComparison.metric);
    }

    filteredAll = (this.groupAllComparisons || []).filter(function(c) {
      if (this.columnComparisons.indexOf(c) >= 0) {
        return false;
      }
      if (regexp !== false && ! c.metric.match(regexp)) {
        return false;
      }
      return true;
    }.bind(this));

    filteredConfigs = (this.groupPageConfigs.slice() || []);

    filteredRow = (this.groupRowComparisons || []).filter(function(c, i) {
      if (c === this.metricComparison) {
        filteredConfigs[i] = null;
        return false;
      }
      if (regexp !== false && ! c.metric.match(regexp)) {
        filteredConfigs[i] = null;
        return false;
      }
      return true;
    }.bind(this));

    filteredConfigs = filteredConfigs.filter(function(c){
      return c !== null;
    }.bind(this));

    if (pageConfig.no_shared_max) {
      minComparison = new CDNMetricSummaryComparison(CDNMetricSummaryComparison.MINIMUM, filteredRow.slice());
      maxComparison = new CDNMetricSummaryComparison(CDNMetricSummaryComparison.MAXIMUM, filteredRow.slice());
    } else {
      minComparison = new CDNMetricSummaryComparison(CDNMetricSummaryComparison.MINIMUM, filteredAll);
      maxComparison = new CDNMetricSummaryComparison(CDNMetricSummaryComparison.MAXIMUM, filteredAll);
    }

    filteredRow.unshift(maxComparison);
    filteredRow.unshift(minComparison);

    CDNHelpers.waitForAll(filteredRow, function(comparison, intermediateCallback) {
      comparison.getValueDescriptions(intermediateCallback);
    }, this.valuesUpdated.bind(this, filteredConfigs));

    return this.cells;
  };

  CDNHistogramCell.prototype.valuesUpdated = function(filteredConfigs, groupValues) {
    var comparison, i, j, waiting;

    comparison = [];

    this.minValue = groupValues.shift();
    this.maxValue = groupValues.shift();

    waiting = 0;

    waiting++;
    // Make top-level array of comparisons with group values within that
    for (i = 0; i < groupValues.length; i++) {
      for (j = 0; j < groupValues[i].length; j++) {
        if (! comparison[j]) {
          comparison[j] = [];
        }
        comparison[j][i] = CDNHelpers.shallowClone(groupValues[i][j]);
        comparison[j][i].groupColumnName = '';
        if (filteredConfigs[i]) {
          if (filteredConfigs[i].title) {
            comparison[j][i].groupColumnName = filteredConfigs[i].title;
          } else if (filteredConfigs[i].metric) {
            waiting++;
            cdnDataManager.translateMetricName(filteredConfigs[i].metric, function(obj, name) {
              obj.groupColumnName = filteredConfigs[i].metric;
              waiting--;

                this.renderCellContents();
              }

          } else if (filteredConfigs[i].header) {
            comparison[j][i].groupColumnName = filteredConfigs[i].header;
          }

      CDNHelpers.removeChildren(this.cells[i]);

  CDNHistogramCell.prototype.drawGraph = function(container, labels, minDesc, maxDesc, values, index) {

      }
      rect.setAttributeNS(null, 'x', x0);
      rect.setAttributeNS(null, 'y', y0);
      rect.setAttributeNS(null, 'width', width);
      rect.setAttributeNS(null, 'height', height);
      rect.setAttributeNS(null, 'fill', fill || 'none');

    bar = 8;
    gap = 4;

    min = minDesc.defined && minDesc.number ? minDesc.rawValue : 0;
    max = maxDesc.defined && maxDesc.number ? maxDesc.rawValue : 1;
    width = Math.max(0, (values.length * (bar + gap)) - gap);
    height = max - min;
    if (height === 0) {
      height = 1;
      if (min !== 0) {
        forceHeight = 1;
      }
    }

    xmlns = 'http://www.w3.org/2000/svg';
    svg = document.createElementNS(xmlns, 'svg');
    svg.setAttributeNS(null, 'viewBox', '0 ' + min + ' ' + width + ' ' + height);
    svg.setAttributeNS(null, 'version', '1.1');
    svg.setAttributeNS(null, 'preserveAspectRatio', 'none');
    svg.setAttributeNS(null, 'width', width + 'px');

        }
        title += values[i].groupColumnName + "\n";
        title += values[i].renderedValue;
        rect.setAttributeNS(null, 'title', title);
        shade.setAttributeNS(null, 'title', title);

        rect.addEventListener('mouseover', this.setPopover.bind(this, shade));
        rect.addEventListener('mouseout', this.removePopover.bind(this, shade));
        shade.addEventListener('mouseover', this.setPopover.bind(this, shade));
        shade.addEventListener('mouseout', this.removePopover.bind(this, shade));
      }

    CDNHelpers.removeChildren(container);
    container.appendChild(svg);
  };

  CDNHistogramCell.prototype.setPopover = function(el, event) {
    var clientRect, x, y;
    if (el && el.hasAttributeNS(null, 'title')) {
      clientRect = el.getBoundingClientRect();
      x = clientRect.left + (clientRect.width / 2);

      this.popover.style.left = x + 'px';
      this.popover.style.top = y + 'px';

  };

  CDNHistogramCell.prototype.removePopover = function(el, event) {
    if (el && el !== this.popoverElement) {
      return;
    }
    if (this.popover.parentNode) {
      this.popover.parentNode.removeChild(this.popover);
    }
  };


  window.CDNHistogramCell = CDNHistogramCell;
})();
